					<h3>about</h3>		
						<p>We present a data processing framework aimed at facilitating the discovery of unknown genes in any genome by 
						extracting DNA, RNA or Protein sub-sequences of any length to execute a variety of genome applications.</p><br>
						<p>Using our GenomePro framework we process raw input data files of any size and in
						 multiple formats such as NGS, FASTA, and GBK by extracting all sub-sequences of lengths selected by the end user. 
						 The only limitations are the computer storage size and/or operating system restrictions.
						 Our framework can be applied to any life form genome. </p>
